import React, { Component } from "react";
import {
  StyleSheet,
  View,
  StatusBar,
  TouchableOpacity,
  Text,
} from "react-native";

import Previous from "./components/Previous";
import Calling from "./components/Calling";

function Game(props) {
  return (
    <React.Fragment>
      <View style={styles.prevContainer}>
        <Previous style={styles.previous}></Previous>
      </View>
      <View style={styles.container}>
        <StatusBar hidden />

        <View style={styles.callingContainer}></View>
        <Calling style={styles.calling}></Calling>
        <View style={styles.rect}></View>
        <View style={styles.buttonContainer2}>
          <View style={styles.buttonContainer}>
            <TouchableOpacity style={styles.button}>
              <Text style={styles.login}>Login</Text>
            </TouchableOpacity>
            <TouchableOpacity style={styles.button}>
              <Text style={styles.login}>Login</Text>
            </TouchableOpacity>
            <TouchableOpacity style={styles.button}>
              <Text style={styles.login}>Login</Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>
    </React.Fragment>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 5,
    backgroundColor: "rgba(236,236,236,1)",
  },
  button: {
    width: 120,
    height: 48,
    backgroundColor: "rgba(242,163,101,1)",
    borderRadius: 12,
    justifyContent: "center",
    alignItems: "center",
    bottom: 0,
  },
  buttonContainer: {
    flexDirection: "row",
    marginTop: 10,
    justifyContent: "space-evenly",
  },
  buttonContainer2: {
    flex: 1,
    justifyContent: "flex-end",
    marginBottom: 10,
  },

  rect: {
    width: 347,
    height: 203,
    backgroundColor: "rgba(255,255,255,1)",
    borderRadius: 10,
    alignSelf: "center",
    marginTop: 30,
  },
  previous: {
    height: 80,
    width: "100%",
    marginTop: 10,
  },
  prevContainer: {
    alignSelf: "center",
    flex: 1,
  },
  calling: {
    height: 170,
    width: 170,
    alignSelf: "center",
  },
  callingContainer: {
    justifyContent: "center",
    alignContent: "center",
    margin: 30,
  },
});

export default Game;
